import React, { Component } from 'react';
import 'tachyons';




class TaskList extends Component
{

	render()
	{
		return (
			<div>
				<h1 className="pa3 heading">TASKS</h1>
				<div className="pa3">
					<input type="submit" value="+ Add a Task" />
					<ul>
						<li>
							<input type="checkbox"/>
							<label>Task 1</label>
						</li>
					</ul>
				</div>
			</div>
		);
	}
}

export default TaskList;
